import React from 'react';
import "./Tile.css"
import { Link } from "react-router-dom";
import education from '../../assets/images/icon-education.png';
import vote from '../../assets/images/icon-vote.png';
import data from '../../assets/images/icon-data.png';

const Tile = props => {
    return (
        <div className={props.classNames}>
            <div className="icon">
                <img
                    src={education}
                    alt={"icon " + props.icon}
                />
            </div>
            <h3>{props.tileTitle}</h3>
            <p>{props.tileText}</p>
            <Link to={props.link}>{props.tileButton}</Link>
        </div>
    )
}

export default Tile;
